preprocess.script:
async script({ attributes, content, filename = "" }) {
      const lang = attributes.lang;
      if (!supportedScriptLangs.includes(lang))
        return;
      const { code, map } = await transformWithEsbuild(content, filename, {
        loader: lang,
        target: "esnext",
        tsconfigRaw: {
          compilerOptions: {
            // svelte typescript needs this flag to work with type imports
            importsNotUsedAsValues: "preserve",
            preserveValueImports: true
          }
        }
      });
      mapSourcesToRelative(map, filename);
      return {
        code,
        map
      };
    }

preprocess.style:
async ({ attributes, content, filename = "" }) => {
    const lang = attributes.lang;
    if (!supportedStyleLangs.includes(lang))
      return;
    if (!transform) {
      let resolvedConfig;
      if (style.__resolvedConfig) {
        resolvedConfig = style.__resolvedConfig;
      } else if (isResolvedConfig(config)) {
        resolvedConfig = config;
      } else {
        resolvedConfig = await resolveConfig(
          config,
          process.env.NODE_ENV === "production" ? "build" : "serve"
        );
      }
      transform = getCssTransformFn(resolvedConfig);
    }
    const moduleId = `${filename}.${lang}`;
    const { code, map } = await transform(content, moduleId);
    mapSourcesToRelative(map, moduleId);
    return {
      code,
      map: map ?? void 0
    };
  }
